영혼이 둥둥 떠가는게 좀 섬뜩하군요
근데 처음부터 다 죽는 건 뭔가 좀....;;
이거 원래 죽는 웹툰 인가요??

.;여주 문제있는거 같은데
잘생긴 남자 보면 잠시 스톤되고;;
상황파악을 못하는거같아..저건 심각한거같은데..물론 나도 스톤걸리는데 상황이 죽은상황인데 ....

우리나라 저승사자들은 왤케 다들 얼굴천재들임?
도깨비에 나오는 저승사자도 그렇고 신과함께 나오는 차사들도 잘생겼더니;;
저 죽으면 저런 저승사자와요? 오면 지금 데려가요

저 토끼 같은 년이랑 곰 같은 년 진짜 개 재수없어;;
앞에서는 찍소리도 못하는 년들이 뒤에서 쑥덕쑥덕;;
진짜 극혐이다 현실이나 저승이나 저런애들은 레알
극혐 중의 상극혐임;;;

아니 죽으면 숙제 없다고 했는데;;
천국에도 없다고 했는데;;
어째서 중간 고사가 있는건가요????
